      SELECT DISTINCT + col0 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT + col1 * + - col0 + + + CAST ( ( col2 ) AS REAL ) + - col2 IS NOT NULL;
  - name: tab2

outputs:
  - name: q6653.out
    data: |
